import style from './Skills.module.css';
import iconHtml from '../../img/htmlRow.svg';
import iconCss from '../../img/cssRow.svg';
import iconJs from '../../img/jsRow.svg';
import iconReact from '../../img/reactRow.svg';
import iconRedux from '../../img/reduxRow.svg';
import iconEx from '../../img/exRow.svg';
import iconNode from '../../img/nodeRow.svg';
import iconPost from '../../img/postgreRow.svg';
import iconSeq from '../../img/seqRow.svg';
import iconGit from '../../img/gitRow.svg';
import iconGitHub from '../../img/githubRow.svg';
import iconMock from '../../img/mockittRow.svg';

const Skills = () => {
    return(
        <div className={style.container}>
            <h1 className={style.title}>Skills</h1>
            <div className={style.subC}>
                <div className={style.firstRow}>
                    <img className={style.rowItem} src={iconHtml} alt="Html" />
                    <img className={style.rowItem} src={iconCss} alt="Html" />
                    <img className={style.rowItem} src={iconReact} alt="Html" />
                    <img className={style.rowItem} src={iconRedux} alt="Html" />
                </div>
                <div className={style.secondRow}>
                    <img className={style.rowItem} src={iconNode} alt="Html" />
                    <img className={style.rowItem} src={iconEx} alt="Html" />
                    <img className={style.rowItem} src={iconSeq} alt="Html" />
                    <img className={style.rowItem} src={iconPost} alt="Html" />
                </div>
                <div className={style.thirdRow}>
                    <img className={style.rowItem} src={iconJs} alt="Html" />
                    <img className={style.rowItem} src={iconGit} alt="Html" />
                    <img className={style.rowItem} src={iconGitHub} alt="Html" />
                    <img className={style.rowItem} src={iconMock} alt="Html" />
                </div>
            </div>
        </div>
    )
}

export default Skills;
